import { Link } from "react-router-dom";

export default function Usernvabar() {
  return (
    <div>
      <Link to="/">Home</Link>
      <Link to="/">score</Link>
      <Link to="/user/ranking">ranking</Link>
      <Link to="/user/contracus">ranking</Link>
      <Link>Login</Link>
    </div>
  );
}
